css:
.autocomplete-plus {
  width: auto !important;
  display: inline-block;
  min-width: 200px;
  margin-left: 0;
  position: relative;
  padding: 2px !important;
}
.autocomplete-plus ol.list-group {
  overflow-y: auto !important;
  margin-top: 0;
  display: inline-block;
}
.autocomplete-plus ol.list-group li:before,
.autocomplete-plus ol.list-group li:after {
  content: " ";
  display: table;
}
.autocomplete-plus ol.list-group li:after {
  clear: both;
}
.autocomplete-plus ol.list-group li .word {
  float: left;
}
.autocomplete-plus ol.list-group li .label {
  float: right;
  opacity: 0.3;
  padding-top: 8px;
}
.autocomplete-plus .hidden-input {
  position: absolute;
  opacity: 0;
  pointer-events: none;
}
